import './TournamentItem.css'

function TournamentItem(props) {
    const temp = "http://localhost:3000/tournament/"
    const t_id = props.t_id
    let link = temp.concat(t_id);

    return (
    <a className="tournament-item" href={link} >
        <p>{props.name}</p>
        <p>{props.matches}</p>
    </a>
)}

export default TournamentItem
